import{newSpecPage}from"@stencil/core/testing";import{PrestoActionBarUi}from"../presto-action-bar-ui";describe("presto-action-bar",(()=>{it("renders",(async()=>{const t=await newSpecPage({components:[PrestoActionBarUi],html:"<presto-action-bar-ui></presto-action-bar-ui>"});expect(t.root).toEqualHtml('\n      <presto-action-bar-ui>\n        <mock:shadow-root>\n          <div class="bar">\n            <span class="bar__content" part="content">\n              <slot></slot>\n            </span>\n            <span class="bar__button" part="button">\n              <slot name="button"></slot>\n            </span>\n          </div>\n        </mock:shadow-root>\n      </presto-action-bar-ui>\n    ')}))}));